    const specialties = {
        graphicDesign : {
            title: "Graphic Design",
            projectTypes: [
                "Visual brand identity",
                "UI Design",
                "Print & Layout design",
                "Illustration"
            ],
        },
        motionDesign : {
            title: "Motion Design",
            projectTypes: [
                "Logo Animation",
                "Explainer video",
                "Character animation"
            ],
        },
    }
